import "./Nav.css";
import React from "react";
import { Link } from "react-router-dom";

export default class Nav extends React.Component {
  render() {
    return (
      <ul>
        <Link>Hi</Link>
        <Link>Hello</Link>
      </ul>
    );
  }
}
